<!DOCTYPE html>
<html>
<head>
<meta charset="utf-8"/>
<meta http-equiv="X-UA-Compatible" content="IE=edge"/>
<meta name="viewport" content="width=device-width, initial-scale=1.0">
<title>CG</title>
<link rel="stylesheet" type="text/css" id="applicationStylesheet" href="CG.css"/>
<script id="applicationScript" type="text/javascript" src="CG.js"></script>
</head>
<body>
<div id="CG">
	<img id="background_" src="background_.png" srcset="background_.png 1x, background_@2x.png 2x">
		
	<div id="MainContent_">
		<svg class="background_ba">
			<rect id="background_ba" rx="0" ry="0" x="0" y="0" width="1602.89" height="716">
			</rect>
		</svg>
		<div id="n_CG">
			<span>工事中　CG</span>
		</div>
	</div>
	<div id="Header_" class="Header">
		<svg class="HeaderBackground_">
			<rect id="HeaderBackground_" rx="8" ry="8" x="0" y="0" width="1799.845" height="100">
			</rect>
		</svg>
		<div onclick="application.goToTargetView(event)" id="Aboutme_Header_" class="Aboutme_Header">
			<svg class="About_">
				<rect id="About_" rx="8" ry="8" x="0" y="0" width="359.226" height="70">
				</rect>
			</svg>
			<div id="About_me_ba">
				<span>About me</span>
			</div>
		</div>
		<div id="CG_Header_bb" class="CG_Header">
			<svg class="CG_bc">
				<rect id="CG_bc" rx="8" ry="8" x="0" y="0" width="359.226" height="70">
				</rect>
			</svg>
			<div id="Computer_Graphics_bd">
				<span>Computer Graphics</span>
			</div>
		</div>
		<div onclick="application.goToTargetView(event)" id="Programming_Header_be" class="Programming_Header">
			<svg class="Programming_bf">
				<rect id="Programming_bf" rx="8" ry="8" x="0" y="0" width="359.226" height="70">
				</rect>
			</svg>
			<div id="Programming_bg">
				<span>Programming</span>
			</div>
		</div>
		<div onclick="application.goToTargetView(event)" id="TopLogo_bh" class="TopLogo">
			<img id="Top_Header_bi" src="Top_Header_bi.png" srcset="Top_Header_bi.png 1x, Top_Header_bi@2x.png 2x">
				
		</div>
	</div>
</div>
</body>
</html>
